import React from 'react'
import ContactItem from '../Components/ContactItem';
import phone from '../img/phone.svg';
import email from '../img/emailme.svg';
import location from '../img/location.svg';
import Tittle from '../Components/Tittle';

function ContactPage() {
    return (
        <div>
            <div className="title">
                <Tittle title={'About Me'} span={'About Me'} />
            </div>
            <div className="ContactPage">
                <div className="map-sect">
                    <iframe src="https://www.google.ru/maps/place/Tech+Academy/@40.4060666,49.8462489,17z/data=!3m1!4b1!4m5!3m4!1s0x40307d6597155fcd:0xe2582559b0c1d8c3!8m2!3d40.4060625!4d49.8484376" width="600" height="450" frameBorder="0" style={{border:0}} allowFullScreen="" aria-hidden="false" tabIndex="0"></iframe>
                </div>
                <div className="contact-sect">
                    <ContactItem icon={phone} text1={'+99450 605-01-94'} title={'Phone'}/>
                    <ContactItem icon={email} text1={'kerimlikerim24@gmail.com'} title={'Email'}/>
                    <ContactItem icon={location} text1={'32 Azadliq St, AZ1001 Baku'} text2={'Azerbaijan'} title={'Address'}/>
                </div>
            </div>
        </div>
    )
}

export default ContactPage;
